import './WGIF.css' 
import promo1 from './promo3.mp4'

const WGIF = () => {
    return (
    <div className="MainVideo">
        <video-js autoplay
    id="my-player"
    className="video-js"
    controls
     
    loop={true}
    preload="auto"
    data-setup='{}'>
  <source src={promo1} type="video/mp4"></source>
 
</video-js>

    </div>
    );
}
 
export default WGIF;
